import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Popover } from '@headlessui/react';

export default function Navbar() {

            const navigate = useNavigate();
            const [isSideMenuOpen, setIsSideMenuOpen] = useState(false);

            function handleHelpClick() {
            navigate('/desktop-4');
            }

            function handleCartClick(){
                navigate('/desktop-2');
            }
return (
    <div className="absolute w-full h-28 bg-darkslategray-100 shadow-[0px_4px_10px_rgba(0,_0,_0,_0.25)] text-11xl text-white font-inter">
    <div className="absolute hidden md:block sm:block top-[41px] left-[881px] 2xl:left-[55.7%] xl:left-[69.04%] lg:left-[56%] md:left-[42%] sm:left-[38%] font-light inline-block w-[130px] h-[34px]"
    onClick={handleCartClick}>
    CART
    </div>
    <img
    className="absolute h-[40.18%] w-[3.49%] top-[31.25%] bottom-[28.57%] 2xl:left-[52.03%] xl:left-[65.03%] lg:left-[52%] md:left-[42%] sm:left-[34%] overflow-hidden max-h-full"
    onClick={handleCartClick}
    alt="cart icon"
    src="/vector.svg"
    />
    <div className="absolute top-[28px] 2xl:left-[290px] xl:left-[290px] lg:left-[200px] md:left-[156px] sm:left-[157px] w-[493px] h-[54px]">
    <input
            type="text"
            className="absolute top-[0px] left-[-1px] rounded-8xs bg-white shadow-[2px_4px_4px_1px_rgba(0,_0,_0,_0.25)_inset] box-border 2xl:w-[494px] xl:w-[494px] lg:w-[367px] md:w-[245px] sm:w-[214px] h-[54px] border-l-[1px] border-solid border-darkslategray-100 h-28 text-11xl text-white font-inter"
            placeholder='search items'
        />
    <div className="absolute top-[0px] 2xl:left-[435px] xl:left-[435px] lg:left-[309px] md:left-[238px] sm:left-[194px] rounded-tl-none rounded-tr-8xs rounded-br-8xs rounded-bl-none bg-whitesmoke-100 w-[57px] h-[54px]" />
    <img
        className="absolute h-[56.67%] w-[6.57%] top-[21.67%] 2xl:right-[2.6%] xl:right-[1.6%] lg:right-[27.8%] md:right-[43.9%] sm:right-[51.8%] bottom-[21.67%] max-w-full overflow-hidden max-h-full"
        alt=""
        src="/vector1.svg"
    />
    </div>
    <div className="absolute top-[32px] 2xl:left-[80%] xl:left-[80%] lg:left-[74%] md:left-[66.6%] sm:left-[56%] h-12 text-whitesmoke-100">

    <img
        className="absolute rounded-3xl hidden md:block top-[0px] left-[143px] 2xl:w-[123px] xl:w-[123px] lg:w-[123px] md:w-[123px] h-12"
        alt=""
        src="/rectangle-4.svg"
    />


    <div className="absolute hidden md:block top-[4px] left-[189px] font-dark text-darkslategray-100 inline-block w-[150px] h-10 [-webkit-text-stroke:1px_#ecf0f1]">
        user
    </div>
    <img
        className="absolute h-[58.33%] top-[18.75%] 2xl:right-[-184px] xl:right-[-184px] lg:right-[-184px] md:right-[-184px] bottom-[22.92%] hidden md:block max-h-full w-7"
        alt=""
        src="/vector3.svg"
    />
    </div>
    <div className=" font-light inline-block w-[150px] h-10"
    onClick={handleHelpClick}>
        Help
    </div>
    <div>
    <img
        className="absolute left-[82px] hidden md:block"
        onClick={handleHelpClick}
        alt=""
        src="/vector2.svg"
    />
    </div>
    <img
    className="absolute h-[40.18%] w-[3.49%] top-[29.46%] 2xl:left-[76.9%] xl:left-[76.5%] lg:left-[70.08%] md:left-[63%] sm:left-[50%] bottom-[30.36%] hidden md:block overflow-hidden h-12"
    alt=""
    src="/vector4.svg"
    />
    <img
    className="absolute top-[27px] 2xl:w-[158px] left-[49px] xl:w-[158px] left-[49px] lg:w-[134px] left-[39px] md:w-[112px] left-[29px] sm:w-[112px] left-[9px] h-[75px]"
    alt=""
    src="/plugin-icon--1-1-1@2x.png"
    />

    {/*for small devices*/}
    <div className="md:hidden">
    <button
    className="absolute top-[24px] left-[490px] w-[75px] h-16 bg-transparent"
    onClick={() => setIsSideMenuOpen(!isSideMenuOpen)}
    >
    <img
        src="/icon.png"
        alt=""
        className="w-full h-full"
    />
    </button>



    </div>
            {/* ... Existing code for larger screens ... */}
            {/* This is the side navigation for sm screens */}
            {isSideMenuOpen && (
                <div className="sm absolute top-[32px] left-[380px]">
                    <ul className="absolute top-[32px] bg-darkslategray-100 text-white font-light">
                        {/* Add your menu options and handlers here */}
                        <li
                            className="p-2 cursor-pointer hover:bg-gray-800"
                            onClick={() => {
                                navigate('/option-1');
                                setIsSideMenuOpen(false); // Close the menu after clicking an option
                            }}
                            style={{
                                textDecoration: 'none', // Remove underline
                                color: 'inherit', // Inherit text color
                                cursor: 'pointer', // Change cursor on hover
                            }}
                        >
                            user
                        </li>
                        <li
                            className="p-2 cursor-pointer hover:bg-gray-800"
                            onClick={handleHelpClick}
                            style={{
                                textDecoration: 'none', // Remove underline
                                color: 'inherit', // Inherit text color
                                cursor: 'pointer', // Change cursor on hover
                            }}
                        >
                            Help
                        </li>
                        <li
                            className="p-2 cursor-pointer hover:bg-gray-800"
                            onClick={() => {
                                navigate('/option-3');
                                setIsSideMenuOpen(false); // Close the menu after clicking an option
                            }}
                            style={{
                                textDecoration: 'none', // Remove underline
                                color: 'inherit', // Inherit text color
                                cursor: 'pointer', // Change cursor on hover
                            }}
                        >
                            Telegram
                        </li>
                        {/* Add more options as needed */}
                    </ul>
                </div>
            )}

    </div>
);
}
